import { withStyles } from "@material-ui/core/styles";
import Product from "./Product";

const useStyles = theme => ({
  root: {
    maxWidth: '100%'
  },
  media: {
    height: 0,
    paddingTop: '56.25%'
  },
  cardContent: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  cartActions: {
    display: 'flex',
    justifyContent: 'flex-end',
  },
    });

export default withStyles(useStyles)(Product)

